import React from 'react';
import { Link, Outlet } from 'react-router-dom'
import logo from '../src/assets/logo.png'
import './App.css'

function App() {
  return (
    <body id='container'>
    <div>
      <link rel='stylesheet' href='App.css'/>
      <img id='logo' src={logo} alt='space-x-logo'/>
      <nav id='nav'>
        <Link to='/dragons'>
          Dragons
        </Link>
        <Link to='/rockets'>
          Rockets
        </Link>
        <Link to='/ships'>
          Ships
        </Link>
      </nav>
    </div>
    </body>
  );
};

export default App;
